import React, { useState } from 'react';

const FeedbackForm = () => {
  const [formData, setFormData] = useState({
    registerNumber: '',
    category: '',
    heading: '',
    summary: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    alert('Feedback submitted successfully!');
    setFormData({
      registerNumber: '',
      category: '',
      heading: '',
      summary: '',
    });
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Feedback Form</h1>
      <form style={styles.form} onSubmit={handleSubmit}>
        
        <div style={styles.formRow}>
          <label style={styles.label} htmlFor="registerNumber">Register Number:</label>
          <input
            type="text"
            id="registerNumber"
            name="registerNumber"
            value={formData.registerNumber}
            onChange={handleChange}
            placeholder="Enter your register number"
            required
            style={styles.input}
          />
        </div>

        <div style={styles.formRow}>
          <label style={styles.label} htmlFor="category">Category:</label>
          <select
            id="category"
            name="category"
            value={formData.category}
            onChange={handleChange}
            required
            style={styles.input}
          >
            <option value="">Select Category</option>
            <option value="General">General</option>
            <option value="Room Issue">Room Issue</option>
            <option value="Maintenance">Maintenance</option>
            <option value="Food Services">Food Services</option>
            <option value="Other">Other</option>
          </select>
        </div>

        <div style={styles.formRow}>
          <label style={styles.label} htmlFor="heading">Heading:</label>
          <input
            type="text"
            id="heading"
            name="heading"
            value={formData.heading}
            onChange={handleChange}
            placeholder="Enter issue heading"
            required
            style={styles.input}
          />
        </div>

        <div style={styles.formRow}>
          <label style={styles.label} htmlFor="summary">Summary:</label>
          <textarea
            id="summary"
            name="summary"
            value={formData.summary}
            onChange={handleChange}
            placeholder="Provide a brief summary of the issue"
            required
            style={styles.input}
          ></textarea>
        </div>

        <button type="submit" style={styles.button}>Submit Issue</button>
      </form>
    </div>
  );
};

const styles = {
  container: {
    width: '80%',
    maxWidth: '600px',
    margin: '0 auto',
    padding: '20px',
    backgroundColor: '#f3f3f3',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
  },
  title: {
    textAlign: 'center',
    color: '#007BA7',
    fontSize: '24px',
    marginBottom: '20px',
  },
  form: {
    display: 'grid',
    gridTemplateColumns: '1fr 2fr',
    gap: '15px',
  },
  formRow: {
    display: 'contents', // Allows each label and input to use the grid structure
  },
  label: {
    display: 'flex',
    alignItems: 'center',
    fontWeight: 'bold',
    color: '#333',
  },
  input: {
    width: '100%',
    padding: '8px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    fontSize: '16px',
  },
  button: {
    gridColumn: 'span 2',
    padding: '10px 20px',
    backgroundColor: '#007BA7',
    color: '#ffffff',
    border: 'none',
    borderRadius: '4px',
    fontSize: '18px',
    cursor: 'pointer',
    textAlign: 'center',
  },
};

export default Feedbackform;
